import { Link } from "react-router-dom";
import { Logo } from "./public/gustaakh-saale.png";

const Navbar = () => {
  return (
    <nav className="navbar" >
      <h1>The Dojo Blog</h1>
      <img src={ Logo } alt="" />
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="/create" style={{ 
          color: 'white', 
          backgroundColor: '#f1356d',
          borderRadius: '8px' 
        }}>New Blog</Link>
      </div>
    </nav>
  );
}

export default Navbar;
